import React from "react";
import Link from "next/link";

const Nav = ({ categories }) => {
  return (
    <>
      {categories.map((category) => {
        return (
          <li key={category.id}>
            <Link as={`/category/${category.slug}`} href="/category/[id]">
              <a>{category.name}</a>
            </Link>
          </li>
        );
      })}
    </>
  );
};

export default Nav;
